-- Dumping data for table `informacion`
--

INSERT INTO informacion VALUES (1,'inf_haab_escritorio','El Haab, es el más similar al calendario que utilizamos en la actualidad con 365 días en su recuento que se basa en observaciones solares. Este calendario, según los expertos, se estima que se utilizó por primera vez alrededor del solsticio de invierno de 550 ANE y fue creado para ser utilizado en conjunto con el Tzolkin.',NULL),(2,'inf_kin_haab_escritorio','El Kin es el equivalente a los días del mes, pero en lugar de 30 o 31 días, se necesitan 20 para formar un uinal (mes maya). Cada uno cuenta con su representación en jeroglífico junto con su nombre individual que no es el nombre de un número regular.',NULL),(3,'inf_uinal_haab_escritorio','El uinal se puede ver como el equivalente a nuestros meses ya que constan de 20 días, pero en lugar de 12 de ellos, el calendario Haab Maya cuenta con 18 de ellos. Los uinales, a parte de contar el tiempo se utilizaban para realizar ciertas actividades.',NULL);

